import { Grid, Typography } from "@material-ui/core";
import "../css/welcome.css";

const Welcome = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      className="welcome"

      style={{
        minHeight: "95vh",
        minWidth:"48vh",
        fontStyle: "italic",
        marginRight: "10px",
        paddingTop: "2rem",
        color: rgb(10, 18, 102),


      }}
    >
      <Grid item>
        <Typography variant="h2" style={{ textAlign: "left" }}>Welcome to JobHub</Typography>
      </Grid>
    </Grid>
  );
};

export const ErrorPage = (props) => {
  return (
    <Grid
      container
      item
      direction="column"
      alignItems="center"
      justify="center"
      style={{ padding: "30px", minHeight: "93vh" }}
    >
      <Grid item>
        <Typography variant="h2">Error 404</Typography>
      </Grid>
    </Grid>
  );
};

export default Welcome;
